import React from 'react';

const Spec = (properties) => {
    return(
        <tr>
          <td>{properties.header}</td>
          <td>{properties.text[0]}</td>
        </tr>
    )
}
const points = properties.text.map((item, pos) => {
  return(
    <td><p>properties.text[0]</p></td>
  )
})

export default Spec;
